//流程设计
import request from '@/utils/request';
export function getExtModel(query) {
  //查询模型列表
  return request({
    url: '/workflow/actExtModel',
    method: 'get',
    params: query
  });
}
export function getModelTree(category) {
  //获取树
  return request({
    url: "/workflow/actExtModel/tree/".concat(category),
    method: 'get'
  });
}
export function addList(data) {
  //添加模型
  return request({
    url: '/workflow/actExtModel',
    method: 'post',
    data: data
  });
}
export function editList(data, id) {
  //编辑模型
  return request({
    url: "/workflow/actExtModel/".concat(id),
    method: 'patch',
    data: data
  });
}
export function deleteList(id) {
  //删除单个模型
  return request({
    url: "/workflow/actExtModel/".concat(id),
    method: 'delete'
  });
}
export function viewPic(modelLinkId) {
  //查看流程图
  return request({
    url: "/workflow/actExtModel/viewProcessImage/".concat(modelLinkId),
    method: 'get'
  });
}
export function downLoadFile(modelLinkId) {
  //查看流程图
  return request({
    url: "/workflow/actExtModel/expworklfow/".concat(modelLinkId),
    method: 'get'
  });
}
export function publishWorkflow(id, modelLinkId) {
  //发布流程
  return request({
    url: "/workflow/actExtModel/".concat(id, "/deploy/").concat(modelLinkId),
    method: 'post'
  });
}
export function revertWorkflow(modelLinkId) {
  //发布流程
  return request({
    url: "/workflow/actExtModel/reverse/".concat(modelLinkId),
    method: 'post'
  });
}
